  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey (USGS), in cooperation
  with the National Oceanic and Atmospheric Administration (NOAA) and the Massachusetts
  Office of Coastal Zone Management (MA CZM), is producing detailed geologic maps
  of the coastal sea floor. Imagery, originally collected by NOAA for charting purposes,
  provide a fundamental framework for research and management activities along this
  part of the Massachusetts coastline, show the composition and terrain of the seabed,
  and provide information on sediment transport and benthic habitat. Interpretive
  data layers were derived from multibeam echo-sounder and sidescan sonar data collected
  in the vicinity of Quicks Hole, a passage through the Elizabeth Islands that extend
  in a chain southwestward off Cape Cod, Massachusetts. In June 2005, bottom photographs
  and surficial sediment data were acquired as part of a ground-truth reconaissance
  survey.\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
